      //   latitude: 40.8221
      //   longitude: -73.988
      //   name: "Cliffside Park"
      //   population: 25142
      // }

      var maxDistance = 100 // in kilometers
      var citiesWithinRange = Cities.closestTo(lat, lng, maxDistance)
      console.log(citiesWithinRange.length)
      // 78

      var minPopulation = 5000000
      var bigCities = Cities.largerThan(minPopulation).asObjects()
      console.log(bigCities[0])
