  function measureDistance(srcLat, srcLng, dstLat, dstLng){
    var origin = L.latLng(srcLat, srcLng),
        point = L.latLng(dstLat, dstLng)
    return origin.distanceTo(point) / 1000 // in kilometers
  }

  function measureDirection(srcLat, srcLng, dstLat, dstLng){
    srcLat *= Math.PI / 180
    dstLat *= Math.PI / 180
    srcLng *= Math.PI / 180
    dstLng *= Math.PI / 180
    var y = Math.sin(dstLng - srcLng) * Math.cos(dstLat),
        x = Math.cos(srcLat) * Math.sin(dstLat) -
            Math.sin(srcLat) * Math.cos(dstLat) * Math.cos(dstLng - srcLng);
    return ((Math.atan2(y, x) * 180 / Math.PI) + 360) % 360;
  }

  function closestCities(lat, lng, predicate, maxDistance){
    predicate = predicate || _.identity
    cutoff = _.isNumber(maxDistance) ? city=>city.distance<=maxDistance : _.identity
    var origin = L.latLng(lat, lng)
    let hits = _.map(_.filter(db, predicate), city=>(_.extend({
      distance:origin.distanceTo(city.point) / 1000,
      direction:measureDirection(lat, lng, city.latitude, city.longitude)
    }, city)))
    return _.sortBy(_.filter(hits, cutoff), 'distance')
  }

  var Cities = {
    closestTo:(lat, lng, maxDist) => closestCities(lat, lng, undefined, maxDist),
    largerThan(pop){
      return {
        closestTo: (lat, lng, maxDist) => closestCities(lat, lng, city=>city.population>=pop, maxDist),
        asObjects: () => _.filter(db, city=>city.population>=pop)
      }
    },
    smallerThan(pop){
      return {
        closestTo: (lat, lng, maxDist) => closestCities(lat, lng, city=>city.population<pop, maxDist),
        asObjects: () => _.filter(db, city=>city.population<pop)
      }
    }

  }

  window.Cities = Cities
